template <typename T>
class PtrVector {
public:
    PtrVector() = default;

    // Ð¡Ð¾Ð·Ð´Ð°Ñ‘Ñ‚ Ð²ÐµÐºÑ‚Ð¾Ñ€ ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»ÐµÐ¹ Ð½Ð° ÐºÐ¾Ð¿Ð¸Ð¸ Ð¾Ð±ÑŠÐµÐºÑ‚Ð¾Ð² Ð¸Ð· other
    PtrVector(const PtrVector& other) {
        // Ð ÐµÐ·ÐµÑ€Ð²Ð¸Ñ€ÑƒÐµÐ¼ Ð¼ÐµÑÑ‚Ð¾ Ð² vector-Ðµ Ð´Ð»Ñ Ñ…Ñ€Ð°Ð½ÐµÐ½Ð¸Ñ Ð½ÑƒÐ¶Ð½Ð¾Ð³Ð¾ ÐºÐ¾Ð»Ð¸Ñ‡ÐµÑÑ‚Ð²Ð° ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ð¾Ð²
        // Ð‘Ð»Ð°Ð³Ð¾Ð´Ð°Ñ€Ñ ÑÑ‚Ð¾Ð¼Ñƒ Ð¿Ñ€Ð¸ push_back Ð½Ðµ Ð±ÑƒÐ´ÐµÑ‚ Ð²Ñ‹Ð±Ñ€Ð°ÑÑ‹Ð²Ð°Ñ‚ÑŒÑÑ Ð¸ÑÐºÐ»ÑŽÑ‡ÐµÐ½Ð¸Ðµ
        items_.reserve(other.items_.size());

        try {
            for (auto p : other.items_) {
                // ÐšÐ¾Ð¿Ð¸Ñ€ÑƒÐµÐ¼ Ð¾Ð±ÑŠÐµÐºÑ‚, ÐµÑÐ»Ð¸ ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»ÑŒ Ð½Ð° Ð½ÐµÐ³Ð¾ Ð½ÐµÐ½ÑƒÐ»ÐµÐ²Ð¾Ð¹
                auto p_copy = p ? new T(*p) : nullptr;  // new Ð¼Ð¾Ð¶ÐµÑ‚ Ð²Ñ‹Ð±Ñ€Ð¾ÑÐ¸Ñ‚ÑŒ Ð¸ÑÐºÐ»ÑŽÑ‡ÐµÐ½Ð¸Ðµ

                // ÐÐµ Ð²Ñ‹Ð±Ñ€Ð¾ÑÐ¸Ñ‚ Ð¸ÑÐºÐ»ÑŽÑ‡ÐµÐ½Ð¸Ðµ, Ñ‚. Ðº. Ð² vector Ð¿Ð°Ð¼ÑÑ‚ÑŒ ÑƒÐ¶Ðµ Ð·Ð°Ñ€ÐµÐ·ÐµÑ€Ð²Ð¸Ñ€Ð¾Ð²Ð°Ð½Ð°
                items_.push_back(p_copy);
            }
        }
        catch (...) {
            // ÑƒÐ´Ð°Ð»ÑÐµÐ¼ ÑÐ»ÐµÐ¼ÐµÐ½Ñ‚Ñ‹ Ð² Ð²ÐµÐºÑ‚Ð¾Ñ€Ðµ Ð¸ Ð¿ÐµÑ€ÐµÐ²Ñ‹Ð±Ñ€Ð°ÑÑ‹Ð²Ð°ÐµÐ¼ Ð¿Ð¾Ð¹Ð¼Ð°Ð½Ð½Ð¾Ðµ Ð¸ÑÐºÐ»ÑŽÑ‡ÐµÐ½Ð¸Ðµ
            DeleteItems();
            throw;
        }
    }

    // Ð”ÐµÑÑ‚Ñ€ÑƒÐºÑ‚Ð¾Ñ€ ÑƒÐ´Ð°Ð»ÑÐµÑ‚ Ð¾Ð±ÑŠÐµÐºÑ‚Ñ‹ Ð² ÐºÑƒÑ‡Ðµ, Ð½Ð° ÐºÐ¾Ñ‚Ð¾Ñ€Ñ‹Ðµ ÑÑÑ‹Ð»Ð°ÑŽÑ‚ÑÑ ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»Ð¸,
    // Ð² Ð²ÐµÐºÑ‚Ð¾Ñ€Ðµ items_
    ~PtrVector() {
        DeleteItems();
    }

    PtrVector& operator=(const PtrVector& rhs)
    {
        if (this != &rhs)
        {
            auto rhs_copy(rhs);
            swap_(rhs_copy);

        }
        return *this;
    }

    void swap_(PtrVector& other) noexcept
    {
        swap(other.items_, this->items_);
    }


    // Ð’Ð¾Ð·Ð²Ñ€Ð°Ñ‰Ð°ÐµÑ‚ ÑÑÑ‹Ð»ÐºÑƒ Ð½Ð° Ð²ÐµÐºÑ‚Ð¾Ñ€ ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»ÐµÐ¹
    vector<T*>& GetItems() noexcept {
        return items_;
    }

    // Ð’Ð¾Ð·Ð²Ñ€Ð°Ñ‰Ð°ÐµÑ‚ ÐºÐ¾Ð½ÑÑ‚Ð°Ð½Ñ‚Ð½ÑƒÑŽ ÑÑÑ‹Ð»ÐºÑƒ Ð½Ð° Ð²ÐµÐºÑ‚Ð¾Ñ€ ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»ÐµÐ¹
    vector<T*> const& GetItems() const noexcept {
        return items_;
    }

private:
    void DeleteItems() noexcept {
        for (auto p : items_) {
            delete p;
        }
    }

    vector<T*> items_;
};

template <typename T>
class ScopedPtr {
public:
    ScopedPtr() = default;

    explicit ScopedPtr(T* raw_ptr) noexcept
        : ptr_(raw_ptr) {
    }

    // Ð—Ð°Ð¿Ñ€ÐµÑ‰Ð°ÐµÐ¼ ÐºÐ¾Ð¿Ð¸Ñ€Ð¾Ð²Ð°Ð½Ð¸Ðµ ÑƒÐºÐ°Ð·Ð°Ñ‚ÐµÐ»Ñ
    ScopedPtr(const ScopedPtr&) = delete;

    ~ScopedPtr() {
        delete ptr_;
    }

    T* GetRawPtr() const noexcept {
        return ptr_;
    }

    T* Release() noexcept {
        T* p = ptr_;
        ptr_ = nullptr;
        return p;
    }

    explicit operator bool() const {
        return ptr_ != nullptr;
    }

    T* operator->() const {
        using namespace std::literals;
        if (!ptr_) {
            throw std::logic_error("Scoped ptr is null"s);
        }
        return ptr_;
    }

    T& operator*() const {
        using namespace std::literals;
        if (!ptr_) {
            throw std::logic_error("Scoped ptr is null"s);
        }
        return *ptr_;
    }

private:
    T* ptr_ = nullptr;
};

