int main() {
    // ÐŸÑ€Ð¾Ð²ÐµÑ€ÐºÐ° Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ñ Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð¾Ð²
    {
        Octopus octopus1(3);

        // ÐÐ°ÑÑ‚Ñ€Ð°Ð¸Ð²Ð°ÐµÐ¼ ÑÐ¾ÑÑ‚Ð¾ÑÐ½Ð¸Ðµ Ð¸ÑÑ…Ð¾Ð´Ð½Ð¾Ð³Ð¾ Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð°
        octopus1.GetTentacle(2).LinkTo(octopus1.GetTentacle(1));

        // Ð”Ð¾ Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ñ octopus2 Ð¸Ð¼ÐµÐµÑ‚ ÑÐ²Ð¾Ñ‘ ÑÐ¾Ð±ÑÑ‚Ð²ÐµÐ½Ð½Ð¾Ðµ ÑÐ¾ÑÑ‚Ð¾ÑÐ½Ð¸Ðµ
        Octopus octopus2(10);

        octopus2 = octopus1;

        // ÐŸÐ¾ÑÐ»Ðµ Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ñ Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð¾Ð² Ñ‰ÑƒÐ¿Ð°Ð»ÑŒÑ†Ð° ÐºÐ¾Ð¿Ð¸Ð¸ Ð¸Ð¼ÐµÑŽÑ‚ Ñ‚Ð¾ Ð¶Ðµ ÑÐ¾ÑÑ‚Ð¾ÑÐ½Ð¸Ðµ,
        // Ñ‡Ñ‚Ð¾ Ð¸ Ñ‰ÑƒÐ¿Ð°Ð»ÑŒÑ†Ð° Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°ÐµÐ¼Ð¾Ð³Ð¾ Ð¾Ð±ÑŠÐµÐºÑ‚Ð°
        assert(octopus2.GetTentacleCount() == octopus1.GetTentacleCount());
        for (int i = 0; i < octopus2.GetTentacleCount(); ++i) {
            auto& tentacle1 = octopus1.GetTentacle(i);
            auto& tentacle2 = octopus2.GetTentacle(i);
            assert(&tentacle2 != &tentacle1);
            assert(tentacle2.GetId() == tentacle1.GetId());
            assert(tentacle2.GetLinkedTentacle() == tentacle1.GetLinkedTentacle());
        }
    }

    // ÐŸÑ€Ð¾Ð²ÐµÑ€ÐºÐ° ÑÐ°Ð¼Ð¾Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ñ Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð¾Ð²
    {
        Octopus octopus(3);

        // ÐÐ°ÑÑ‚Ñ€Ð°Ð¸Ð²Ð°ÐµÐ¼ ÑÐ¾ÑÑ‚Ð¾ÑÐ½Ð¸Ðµ Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð°
        octopus.GetTentacle(0).LinkTo(octopus.GetTentacle(1));

        vector<pair<Tentacle*, Tentacle*>> tentacles;
        // Ð¡Ð¾Ñ…Ñ€Ð°Ð½ÑÐµÐ¼ Ð¸Ð½Ñ„Ð¾Ñ€Ð¼Ð°Ñ†Ð¸ÑŽ Ð¾ Ñ‰ÑƒÐ¿Ð°Ð»ÑŒÑ†Ð°Ñ… Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð° Ð¸ ÐµÐ³Ð¾ ÐºÐ¾Ð¿Ð¸Ð¸
        for (int i = 0; i < octopus.GetTentacleCount(); ++i) {
            tentacles.push_back({ &octopus.GetTentacle(i), octopus.GetTentacle(i).GetLinkedTentacle() });
        }

        // Ð’Ñ‹Ð¿Ð¾Ð»Ð½ÑÐµÐ¼ ÑÐ°Ð¼Ð¾Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ðµ
        octopus = octopus;

        // ÐŸÐ¾ÑÐ»Ðµ ÑÐ°Ð¼Ð¾Ð¿Ñ€Ð¸ÑÐ²Ð°Ð¸Ð²Ð°Ð½Ð¸Ñ ÑÐ¾ÑÑ‚Ð¾ÑÐ½Ð¸Ðµ Ð¾ÑÑŒÐ¼Ð¸Ð½Ð¾Ð³Ð° Ð½Ðµ Ð´Ð¾Ð»Ð¶Ð½Ð¾ Ð¸Ð·Ð¼ÐµÐ½Ð¸Ñ‚ÑŒÑÑ
        assert(octopus.GetTentacleCount() == static_cast<int>(tentacles.size()));
        for (int i = 0; i < octopus.GetTentacleCount(); ++i) {
            auto& tentacle_with_link = tentacles.at(i);
            assert(&octopus.GetTentacle(i) == tentacle_with_link.first);
            assert(octopus.GetTentacle(i).GetLinkedTentacle() == tentacle_with_link.second);
        }
    }
}

#include <iostream>
